// ==UserScript==
// @name         Copy-paste bypasser
// @namespace    https://github.com/yeongaori/userscript
// @version      1.0
// @updateURL    https://github.com/yeongaori/userscript/raw/master/copypastebypasser.user.js
// @downloadURL  https://github.com/yeongaori/userscript/raw/master/copypastebypasser.user.js
// @description  Copy and paste everywhere you want!
// @author       Yeongaori
// @match        *://*/*
// @icon         data:image/png;base64,
// @grant        none
// ==/UserScript==

(function() {
    var e, i, all;

    document.onmouseup = null;
    document.onmousedown = null;
    document.oncontextmenu = null;

    all = document.getElementsByTagName("*");
    for (i = 0; i < all.length; i += 1) {
        e = all[i];
        e.onmouseup = null;
        e.onmousedown = null;
        e.oncontextmenu = null;
    }
})();
